import React, { useState, useEffect } from "react";

const Watchlist = () => {
  const [watchlist, setWatchlist] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedWatch, setSelectedWatch] = useState(null);
  const [showModal, setShowModal] = useState(false); // eslint-disable-next-line
  const [showEditModal, setShowEditModal] = useState(false);
  const [formData, setFormData] = useState({
    dates: "",
    symbol: "",
    price: "",
    target_price: "",
    exp_date: "",
    plan: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (showEditModal) {
      setSelectedWatch({ ...selectedWatch, [name]: value });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };
  useEffect(() => {
    fetch("http://localhost:8000/watchlist/")
      .then((response) => response.json())
      .then((data) => {
        setWatchlist(data.watchlist_entries);
        setLoading(false);
      })
      .catch((err) => {
        setError(err.message);
        setLoading(false);
      });
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error: {error}</p>;

  return (
    <div className="watchlist">
      <div className="header">
        <p>Watchlist</p>
        <i className="fa-solid fa-plus" id="new-btn"></i>
      </div>
      <div className="list">
        <ul className="item">
          {watchlist.map((entry, index) => (
            <li key={index} className="card-content">
              <div className="left">
                <p className="symbol">{entry[2]}</p>
              </div>
              <div className="right">
                <p className="price">Price: ${entry[3]}</p>
                <p className="target-price">Target: ${entry[4]}</p>
                <p className="exp-date">
                  Expiry: {entry[5].split("-").slice(1).join("/")}
                </p>
              </div>
            </li>
          ))}
        </ul>
      </div>
      {showModal && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header">
              <span className="close" onClick={() => setShowModal(false)}>
                &times;
              </span>
              <div>Trade</div>
            </div>

            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={formData.symbol}
                onChange={handleChange}
              />

              <label htmlFor="option_type">Option Type:</label>
              <input
                type="text"
                name="option_type"
                value={formData.option_type}
                onChange={handleChange}
              />

              <label htmlFor="strike_price">Strike Price:</label>
              <input
                type="text"
                name="strike_price"
                value={formData.strike_price}
                onChange={handleChange}
              />

              <label htmlFor="exp_date">Exp. Date:</label>
              <input
                type="date"
                name="exp_date"
                value={formData.exp_date}
                onChange={handleChange}
              />

              <label htmlFor="entry_price">Entry Price:</label>
              <input
                type="text"
                name="entry_price"
                value={formData.entry_price}
                onChange={handleChange}
              />

              <label htmlFor="exit_price">Exit Price:</label>
              <input
                type="text"
                name="exit_price"
                value={formData.exit_price}
                onChange={handleChange}
              />

              <label htmlFor="contracts">Contracts:</label>
              <input
                type="text"
                name="contracts"
                value={formData.contracts}
                onChange={handleChange}
              />

              <label htmlFor="entry_date">Entry Date:</label>
              <input
                type="date"
                name="entry_date"
                value={formData.entry_date}
                onChange={handleChange}
              />

              <label htmlFor="close_date">Close Date:</label>
              <input
                type="date"
                name="close_date"
                value={formData.close_date}
                onChange={handleChange}
              />

              <button type="submit">Add Trade</button>
            </form>
          </div>
        </div>
      )}
      {showEditModal && selectedTrade && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header">
              <span className="close" onClick={() => setShowEditModal(false)}>
                &times;
              </span>
              <div>{selectedTrade.symbol}</div>
            </div>

            <form className="edit-trade-form" onSubmit={handleEditSubmit}>
              <label htmlFor="option_type">Option Type:</label>
              <input
                type="text"
                name="option_type"
                value={selectedTrade.optionType}
                onChange={(e) =>
                  setSelectedTrade({
                    ...selectedTrade,
                    optionType: e.target.value,
                  })
                }
              />

              <label htmlFor="strike_price">Strike Price:</label>
              <input
                type="text"
                name="strike_price"
                value={selectedTrade.strikePrice}
                onChange={(e) =>
                  setSelectedTrade({
                    ...selectedTrade,
                    strikePrice: e.target.value,
                  })
                }
              />
              <label htmlFor="contracts">Contracts:</label>
              <input
                type="text"
                name="contracts"
                value={selectedTrade.contracts}
                onChange={(e) =>
                  setSelectedTrade({
                    ...selectedTrade,
                    contracts: e.target.value,
                  })
                }
              />

              <label htmlFor="entry_price">Entry Price:</label>
              <input
                type="text"
                name="entry_price"
                value={selectedTrade.entryPrice}
                onChange={(e) =>
                  setSelectedTrade({
                    ...selectedTrade,
                    entryPrice: e.target.value,
                  })
                }
              />

              <label htmlFor="exit_price">Exit Price:</label>
              <input
                type="text"
                name="exit_price"
                value={selectedTrade.exitPrice}
                onChange={(e) =>
                  setSelectedTrade({
                    ...selectedTrade,
                    exitPrice: e.target.value,
                  })
                }
              />

              <label htmlFor="close_date">Close Date:</label>
              <input
                type="date"
                name="close_date"
                value={selectedTrade.closeDate}
                onChange={(e) =>
                  setSelectedTrade({
                    ...selectedTrade,
                    closeDate: e.target.value,
                  })
                }
              />

              <button type="submit">Update</button>
            </form>
          </div>
        </div>
      )}{" "}
    </div>
  );
};

export default Watchlist;
